[{"location":"","page":"Overview","title":"Overview","text":"CurrentModule = TypedFASTX\nDocTestSetup = quote\n    using TypedFASTX, FASTX, BioSequences\nend","category":"page"},{"location":"#TypedFASTX","page":"Overview","title":"TypedFASTX","text":"","category":"section"},{"location":"","page":"Overview","title":"Overview","text":"(Image: Latest Release) (Image: MIT license) (Image: Documentation) (Image: Status) (Image: Coverage)","category":"page"},{"location":"","page":"Overview","title":"Overview","text":"FASTX records with typed sequences and optional qualities.","category":"page"},{"location":"#Installation","page":"Overview","title":"Installation","text":"","category":"section"},{"location":"","page":"Overview","title":"Overview","text":"You can install TypedFASTX from the Julia REPL. Type ] to enter the Pkg REPL mode and run:","category":"page"},{"location":"","page":"Overview","title":"Overview","text":"(@v1.9) pkg> add TypedFASTX","category":"page"},{"location":"#Quickstart","page":"Overview","title":"Quickstart","text":"","category":"section"},{"location":"","page":"Overview","title":"Overview","text":"Like FASTX.jl, TypedFASTX.jl is used for handling FASTA and FASTQ files. The main difference is that the sequence field is typed (it is not just a raw array of ASCII bytes). Records can be created using the TypedFASTA and TypedFASTQ modules.","category":"page"},{"location":"","page":"Overview","title":"Overview","text":"Construct a FASTA record:","category":"page"},{"location":"","page":"Overview","title":"Overview","text":"julia> record = DNARecord(\"ricky the record\", \"GATTACA\");\n\njulia> sequence(record)\n7nt DNA Sequence:\nGATTACA\n\njulia> (identifier(record), description(record), sequence(record))\n(\"ricky\", \"ricky the record\", GATTACA)","category":"page"},{"location":"","page":"Overview","title":"Overview","text":"","category":"page"},{"location":"","page":"Overview","title":"Overview","text":"Modules = [TypedFASTX]","category":"page"},{"location":"#TypedFASTX.AAReader","page":"Overview","title":"TypedFASTX.AAReader","text":"AAReader\n\nAlias for TypedReader{LongAA}. Can be used for constructing TypedFASTAReader{LongAA} and TypedFASTQReader{LongAA} instances.\n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.AARecord","page":"Overview","title":"TypedFASTX.AARecord","text":"AARecord\n\nAlias for TypedRecord{LongAA}. Can be used for constructing TypedFASTA.Record{LongAA} and TypedFASTQ.Record{LongAA} instances. \n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.AAWriter","page":"Overview","title":"TypedFASTX.AAWriter","text":"AAWriter\n\nAlias for TypedWriter{LongAA}. Can be used for constructing TypedFASTAWriter{LongAA} and TypedFASTQWriter{LongAA} instances.\n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.DNAReader","page":"Overview","title":"TypedFASTX.DNAReader","text":"DNAReader\n\nAlias for TypedReader{LongDNA{4}}. Can be used for constructing TypedFASTAReader{LongDNA{4}} and TypedFASTQReader{LongDNA{4}} instances.\n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.DNARecord","page":"Overview","title":"TypedFASTX.DNARecord","text":"DNARecord\n\nAlias for TypedRecord{LongDNA{4}}. Can be used for constructing TypedFASTA.Record{LongDNA{4}} and TypedFASTQ.Record{LongDNA{4}} instances. \n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.DNAWriter","page":"Overview","title":"TypedFASTX.DNAWriter","text":"DNAWriter\n\nAlias for TypedWriter{LongDNA{4}}. Can be used for constructing TypedFASTAWriter{LongDNA{4}} and TypedFASTQWriter{LongDNA{4}} instances.\n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.QualityScores","page":"Overview","title":"TypedFASTX.QualityScores","text":"QualityScores\n\nA type for storing FASTQ quality with different encodings.\n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.RNAReader","page":"Overview","title":"TypedFASTX.RNAReader","text":"RNAReader\n\nAlias for TypedReader{LongRNA{4}}. Can be used for constructing TypedFASTAReader{LongRNA{4}} and TypedFASTQReader{LongRNA{4}} instances.\n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.RNARecord","page":"Overview","title":"TypedFASTX.RNARecord","text":"RNARecord\n\nAlias for TypedRecord{LongRNA{4}}. Can be used for constructing TypedFASTA.Record{LongRNA{4}} and TypedFASTQ.Record{LongRNA{4}} instances. \n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.RNAWriter","page":"Overview","title":"TypedFASTX.RNAWriter","text":"RNAWriter\n\nAlias for TypedWriter{LongRNA{4}}. Can be used for constructing TypedFASTAWriter{LongRNA{4}} and TypedFASTQWriter{LongRNA{4}} instances.\n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.StringReader","page":"Overview","title":"TypedFASTX.StringReader","text":"StringReader\n\nAlias for TypedReader{String}. Can be used for constructing TypedFASTAReader{String} and TypedFASTQReader{String} instances.\n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.StringRecord","page":"Overview","title":"TypedFASTX.StringRecord","text":"StringRecord\n\nAlias for TypedRecord{String}. Can be used for constructing TypedFASTA.Record{String} and TypedFASTQ.Record{String} instances. \n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.StringWriter","page":"Overview","title":"TypedFASTX.StringWriter","text":"StringWriter\n\nAlias for TypedWriter{String}. Can be used for constructing TypedFASTAWriter{String} and TypedFASTQWriter{String} instances.\n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.TypedReader","page":"Overview","title":"TypedFASTX.TypedReader","text":"TypedReader{T}\n\nAbstract type for typed FASTX readers. T is the type of the sequence in the records.\n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.TypedReader-Union{Tuple{String}, Tuple{T}} where T","page":"Overview","title":"TypedFASTX.TypedReader","text":"Constructor for TypedReader{T} that looks at the file extension of the given path to decide reader type.\n\n\n\n\n\n","category":"method"},{"location":"#TypedFASTX.TypedRecord","page":"Overview","title":"TypedFASTX.TypedRecord","text":"TypedRecord{T}\n\nAbstract type for typed FASTX records.\n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.TypedWriter","page":"Overview","title":"TypedFASTX.TypedWriter","text":"TypedWriter{T}\n\nAbstract type for typed FASTX writers. T is the type of the sequence in the records.\n\n\n\n\n\n","category":"type"},{"location":"#TypedFASTX.TypedWriter-Union{Tuple{String}, Tuple{T}} where T","page":"Overview","title":"TypedFASTX.TypedWriter","text":"Constructor for TypedWriter{T} that looks at the file extension of the given path to decide writer type.\n\n\n\n\n\n","category":"method"},{"location":"#FASTX.description-Tuple{TypedRecord}","page":"Overview","title":"FASTX.description","text":"description(record::TypedRecord)::String\n\nGet the entire description of record. Returns a String.\n\n\n\n\n\n","category":"method"},{"location":"#FASTX.identifier-Tuple{TypedRecord}","page":"Overview","title":"FASTX.identifier","text":"identifier(record::TypedRecord)::SubString{String}\n\nGet the identifier of record. The identifier is the first \"word\" of the description. Returns a SubString{String}.\n\n\n\n\n\n","category":"method"},{"location":"#FASTX.sequence-Union{Tuple{TypedRecord{T}}, Tuple{T}} where T","page":"Overview","title":"FASTX.sequence","text":"sequence(record::TypedRecord{T})::T\n\nReturns the sequence of record.\n\n\n\n\n\n","category":"method"},{"location":"#FASTX.sequence-Union{Tuple{T}, Tuple{Type{T}, TypedRecord}} where T","page":"Overview","title":"FASTX.sequence","text":"sequence(T, record::TypedRecord)::T\n\nReturns the sequence of record, converted to type T.\n\n\n\n\n\n","category":"method"}]
